import React, {useEffect} from "react";
import ImgBtn from "./ImgBtn";


export default function Body() {
    const imgbtns = []
    for (let i = 1; i < 18; i++) {
        const url = `src/character/body/${i}.png`;
        imgbtns.push(<ImgBtn url={url} handleChange={() => {}}/>); 
    }
    return (
        <div>
            <h3>BODY</h3>
            <div>{imgbtns}</div>
        </div>
    )
}
